import React from 'react';
import './MessageBar.css';

function MessageBar() {
    return (
        <footer className="message-bar">
            <input type="text" id="user-message" placeholder="Type your message here..." />
            <button id="send-button">Send</button>
        </footer>
    );
}

export default MessageBar;
